if (process.browser) {
  (function () {
    const reportTabItems = document.querySelectorAll(".report-tab-item");
    reportTabItems.forEach((item) => {
      item.addEventListener("click", (e) => {
        console.log(e.target.value);
        item.classList.toggle("active");
      });
    });
  })();
}
